package com.arcsoft.arcfacedemo.net.bean;

public class JsonPolicePhoto {

    /**
     * emp_id : 000001
     * emp_name : zzd
     * bdsj : 2020-04-01T06:13:41.883Z
     * bdzp : 
     */

    private String emp_id;
    private String emp_name;
    private String bdsj;
    private String bdzp;

    public JsonPolicePhoto(String emp_id, String emp_name, String bdsj, String bdzp) {
        this.emp_id = emp_id;
        this.emp_name = emp_name;
        this.bdsj = bdsj;
        this.bdzp = bdzp;
    }

    public String getEmp_id() {
        return emp_id;
    }

    public void setEmp_id(String emp_id) {
        this.emp_id = emp_id;
    }

    public String getEmp_name() {
        return emp_name;
    }

    public void setEmp_name(String emp_name) {
        this.emp_name = emp_name;
    }

    public String getBdsj() {
        return bdsj;
    }

    public void setBdsj(String bdsj) {
        this.bdsj = bdsj;
    }

    public String getBdzp() {
        return bdzp;
    }

    public void setBdzp(String bdzp) {
        this.bdzp = bdzp;
    }
}
